import React, { Component } from 'react';

class OrderPromotion extends Component{

  render(){
    return (
      <div className="animated fadeIn">
        <div className="ubuntu-app " style={{border:0, marginTop: 20}}>
            <main>
                DS Khuyến mãi
            </main>
        </div>
      </div>
    )
  }
}

export default OrderPromotion;
